    'about.AboutBrand': '\u03A3\u03C7\u03B5\u03C4\u03B9\u03BA\u03AC \u03BC\u03B5 \u03C4\u03B7\u03BD OLX',
    'about.AboutText1': '\u0397 OLX \u03B5\u03AF\u03BD\u03B1\u03B9 \u03B7 \u03BC\u03B5\u03B3\u03B1\u03BB\u03CD\u03C4\u03B5\u03C1\u03B7 \u03C0\u03BB\u03B1\u03C4\u03C6\u03CC\u03C1\u03BC\u03B1 \u03B1\u03B3\u03B3\u03B5\u03BB\u03B9\u03CE\u03BD \u03BC\u03AD\u03C3\u03C9 \u03BA\u03B9\u03BD\u03B7\u03C4\u03CE\u03BD \u03BA\u03B1\u03B9 \u03C5\u03C0\u03BF\u03BB\u03BF\u03B3\u03B9\u03C3\u03C4\u03AE \u03C0\u03B1\u03B3\u03BA\u03BF\u03C3\u03BC\u03AF\u03C9\u03C2 \u03C0\u03BF\u03C5 \u03B5\u03C3\u03C4\u03B9\u03AC\u03B6\u03B5\u03B9 \u03C3\u03B5 \u03B1\u03BD\u03B1\u03B4\u03C5\u03CC\u03BC\u03B5\u03BD\u03B5\u03C2 \u03B1\u03B3\u03BF\u03C1\u03AD\u03C2',
    'about.AboutText2': '\u0397 OLX \u03B4\u03C1\u03B1\u03C3\u03C4\u03B7\u03C1\u03B9\u03BF\u03C0\u03BF\u03B9\u03B5\u03AF\u03C4\u03B1\u03B9 \u03C3\u03B5 \u03CC\u03BB\u03BF \u03C4\u03BF\u03BD \u03BA\u03CC\u03C3\u03BC\u03BF \u03BC\u03B5 \u03C0\u03B1\u03C1\u03BF\u03C5\u03C3\u03AF\u03B1 \u03C3\u03B5 \u03C0\u03B5\u03C1\u03B9\u03C3\u03C3\u03CC\u03C4\u03B5\u03C1\u03B5\u03C2 \u03B1\u03C0\u03CC operates 40 \u03C7\u03CE\u03C1\u03B5\u03C2',
