    'about.MissionText1': '\u0392\u03B5\u03BB\u03C4\u03B9\u03CE\u03BD\u03BF\u03C5\u03BC\u03B5 \u03C4\u03B9\u03C2 \u03B6\u03C9\u03AD\u03C2 \u03C4\u03C9\u03BD \u03B1\u03BD\u03B8\u03C1\u03CE\u03C0\u03C9\u03BD \u03C6\u03AD\u03C1\u03BD\u03BF\u03BD\u03C4\u03B1\u03C2 \u03C4\u03BF\u03C5\u03C2 \u03C3\u03B5 \u03B5\u03C0\u03B1\u03C6\u03AE \u03B3\u03B9\u03B1 \u03C3\u03C5\u03BD\u03B1\u03BB\u03BB\u03B1\u03B3\u03AD\u03C2 \u03C3\u03C4\u03B9\u03C2 \u03BF\u03C0\u03BF\u03AF\u03B5\u03C2 \u03BA\u03B1\u03B9 \u03C4\u03B1 \u03B4\u03CD\u03BF \u03BC\u03AD\u03C1\u03B7 \u03B5\u03AF\u03BD\u03B1\u03B9 \u03BA\u03B5\u03C1\u03B4\u03B9\u03C3\u03BC\u03AD\u03BD\u03B1',
